import Header from './header';
import Post from './post';
import Moodal from './modal';
import axios from 'axios';
import React, { useState, useEffect } from 'react';
import { render } from '@testing-library/react';
import {Switch, Route, Link, Router} from 'react-router-dom';
import Home from './ViewHome';
import Negocios from './ViewNegocios';
import Jogos from './ViewJogos';
import Educacao from './ViewEducacao';
import Tec from './ViewTec';

function Master() {
    return(
        <>
        <Header></Header>
                

                <main>
                    <Router>
                    <Switch>
                        <Route path="/home" component={Home}/>
                        <Route path="/jogos" component={Jogos}/>
                        <Route path="/educacao" component={Educacao}/>
                        <Route path="/tec" component={Tec}/>
                        <Route path="/negocios" component={Negocios}/>                   
                    </Switch>
                    </Router>
                </main>


            </>

    );
    }
export default Master;
